import React from "react";
import { Link } from "react-scroll";
import "./SideDrawer.css";

const sideDrawer = props => {
  let drawerClasses = ["side-drawer"];

  if (props.show) {
    drawerClasses = "side-drawer open";
  }
  return (
  <nav className = {drawerClasses}>
    <ul>
    <li><Link
  activeClass="active"
  to= "col form-container"
  spy={true}
  smooth={true}
  offset={-70}
  duration= {500}>
Park Info </Link></li>
    <li><Link
  activeClass="active"
  to= "col form-containerVisitor"
  spy={true}
  smooth={true}
  offset={-70}
  duration= {100}>
Visitor Centers </Link></li>
<li><Link
activeClass="active"
to= "col form-containerArticles"
spy={true}
smooth={true}
offset={-70}
duration= {100}>
Articles </Link></li>
<li><Link
activeClass="active"
to= "col form-containerNews"
spy={true}
smooth={true}
offset={-70}
duration= {500}>
News Releases </Link></li>
<li><Link
activeClass="active"
to= "col form-containerEducation"
spy={true}
smooth={true}
offset={-70}
duration= {500}>
Educational Info </Link></li>
<li><Link
activeClass="active"
to= "col form-containerEvents"
spy={true}
smooth={true}
offset={-70}
duration= {500}>
Events </Link></li>
<li><Link
activeClass="active"
to= "col form-containerAlerts"
spy={true}
smooth={true}
offset={-70}
duration= {500}>
Alerts </Link></li>
    </ul>
  </nav>
);
};

export default sideDrawer;
